const AddPost = () => {
    return(
        <div className={c.AddPost}>
            <p>Заголовок:</p>
            <div className={c.Title}>
                <input></input>
            </div>
            <div className={c.Text}>
                <textarea></textarea>
            </div>
            <button>Добавить пост</button>
        </div>
    )
}

export default AddPost;
